    # Game text prompts
    StartPrompt: .asciiz "Welcome to goal score!\nUse 'w', 's', 'a', 'd' keys to move the ball and score in the goal!\n"
    NextPrompt: .asciiz "Score 3 goals to win! Be careful not to go out of bounds!\n"
    game_over_msg: .asciiz "Game Over! You've scored 3 goals!\n Your total score is: "
    hit_boundary_msg: .asciiz "Oops! Hit the boundary. Try again!\n"
    score_msg: .asciiz "Goal! Your score increased!\n Goals scored: "
    playAgain: .asciiz "Do you want to play again?"
    
    # Game state storage
    ball_pos: .word 0     # Current ball position
    goal_pos: .word 0       # Current goal positions
