    number1: .word 1
    number2: .word 2
    

.text
######################## MENU Set-up #####################
.globl main

main:
    
    la $t0, display_buffer    
    la $t1, start_picture   
    li $t2, 0                 
    li $t3, 2048            
display_loop1:
    beq $t2, $t3, check_input  
    
    lw $t4, 0($t1)            
    sw $t4, 0($t0)            
    
    addi $t0, $t0, 4       
    addi $t1, $t1, 4         
    addi $t2, $t2, 1         
    j display_loop1           

check_input:
    li $t0, 0xffff0000        
input_wait:
    lw $t1, 0($t0)           
    andi $t1, $t1, 1          
    beqz $t1, input_wait         
    
    lw $t2, 4($t0)   
          
    li $t3, 49               
    beq $t2, $t3, BEGIN      
 
    li $t3, 50               
    beq $t2, $t3, gameOver  
    
   
    j check_input


######################## Initial Set-up #####################
BEGIN:
    # Initialize game environment and registers
    la $t0, squares        
    
    # Load colors into registers
    lw $t3, white 
    lw $t4, orange
    lw $t5, grey
    lw $t6, black
    sw $zero, 0xffff0004   # Reset keyboard input
    
    # Reset game counters and flags
    li $s0, 0   # Collision counter
    li $s3, 0   # Score
    li $s6, 0   # Bullet1_collision flag
    li $t9, 0   # Timer flag
    
    # Reset goals count
    sw $zero, goals_count
    
    # Set initial ball position to bottom middle
    li $t1, 3584           
    sw $t1, ball_pos     
    
    # Generate random goal position
    jal RandomGoalPosition
    
Draw:
    # Draw the complete game screen with background
    la $t1, squares        
    lw $t2, background     
    li $t7, 2048           # Counter for all squares
DrawBG:
    # Fill the entire bitmap with background color
    sw $t2, 0($t1)         
    addi $t1, $t1, 4       
    addi $t7, $t7, -1      
    beqz $t7, Drawball 
    j DrawBG               
    
Drawball:
    # Draw the yellow ball at current position
    lw $t8, ball_pos     
    la $t0, squares        
    add $t8, $t0, $t8      
    lw $t2, yellow         
    sw $t2, 0($t8)         
    
    j DrawGoal

DrawGoal:
    # Draw the soccer goal with posts and inner area
    lw $t1, goal_pos       
    la $t0, squares        
    add $t0, $t0, $t1      
    
    lw $t2, white          # Goal post color
    lw $t3, grey           # Goal inner fill color

    # Draw LEFT vertical white post
    li $t1, 8
    move $t4, $t0          
DrawLeftPost:
    sw $t2, 0($t0)
    addi $t0, $t0, 256     # Move down one row
    addi $t1, $t1, -1
    bnez $t1, DrawLeftPost

    # Draw TOP horizontal white bar
    move $t0, $t4          
    li $t1, 6
DrawTopBar:
    sw $t2, 0($t0)
    addi $t0, $t0, 4       # Move right
    addi $t1, $t1, -1
    bnez $t1, DrawTopBar

    # Fill inner goal area with grey
    move $t0, $t4          
    addi $t0, $t0, 260     # Start position (1 row down, 1 col right)
    li $t5, 7              # Number of rows
FillGreyRows:
    li $t6, 5              # Columns per row
    move $t7, $t0          # Start of row
FillGreyCols:
    sw $t3, 0($t7)
    addi $t7, $t7, 4       # Move right
    addi $t6, $t6, -1
    bnez $t6, FillGreyCols

    addi $t0, $t0, 256     # Move to next row start
    addi $t5, $t5, -1
    bnez $t5, FillGreyRows

DrawSoccerBalls:
    # Draw soccer balls representing remaining goals needed
    la  $t1, squares    
    lw $t3, black      
    lw $t7, white      

    li $t4, 3           # Three soccer balls total
SoccerBallLoop:
    # Draw 5x5 pixel soccer ball pattern
    # Row 1
    sw $t7, 6884($t1)   
    sw $t3, 6888($t1)   
    sw $t7, 6892($t1)   
    sw $t7, 6896($t1)   
    sw $t7, 6900($t1)   
    
    # Row 2
    sw $t3, 7140($t1)   
    sw $t7, 7144($t1)   
    sw $t3, 7148($t1)   
    sw $t7, 7152($t1)   
    sw $t3, 7156($t1)   
    
    # Row 3
    sw $t7, 7396($t1)   
    sw $t3, 7400($t1)   
    sw $t7, 7404($t1)   
    sw $t3, 7408($t1)   
    sw $t7, 7412($t1)   
    
    # Row 4
    sw $t3, 7652($t1)   
    sw $t7, 7656($t1)   
    sw $t3, 7660($t1)   
    sw $t7, 7664($t1)   
    sw $t3, 7668($t1)   
    
    # Row 5
    sw $t7, 7908($t1)   
    sw $t7, 7912($t1)   
    sw $t3, 7916($t1)   
    sw $t7, 7920($t1)   
    sw $t7, 7924($t1)   

    addi $t4, $t4, -1   
    addi $t1, $t1, -80  # Space between balls
    bnez $t4, SoccerBallLoop
#####################################################################
   
    # Display welcome message and instructions
    li $v0, 59          
    la $a0, StartPrompt
    la $a1, NextPrompt
    syscall
   
    j gameLoop          # Start the game

### Initial Set Up is over
####################################################################
   
ReDraw:
    # Redraw screen after ball movement
    li $t9, 1 # Start timer flag

    # Reset keyboard input
    sw $zero, 0xffff0004    
    
    # Redraw the background
    la $t1, squares
    lw $t2, background
    li $t7, 2048
ReDrawBG:
    sw $t2, 0($t1)
    addi $t1, $t1, 4
    addi $t7, $t7, -1
    beqz $t7, ReDrawball
    j ReDrawBG

ReDrawball:
    # Redraw ball at updated position
    lw $t8, ball_pos      
    la $t0, squares         
    add $t8, $t0, $t8       
    lw $t2, yellow          
    sw $t2, 0($t8)          
    
    j ReDrawGoal

ReDrawGoal:
    # Redraw the goal at current position
    lw $t1, goal_pos        
    la $t0, squares         
    add $t0, $t0, $t1       
    
    lw $t2, white           
    lw $t3, grey            

    # Left post
    li $t1, 8
    move $t4, $t0           
ReDrawLeftPost:
    sw $t2, 0($t0)
    addi $t0, $t0, 256      
    addi $t1, $t1, -1
    bnez $t1, ReDrawLeftPost

    # Top bar
    move $t0, $t4           
    li $t1, 6
ReDrawTopBar:
    sw $t2, 0($t0)
    addi $t0, $t0, 4        
    addi $t1, $t1, -1
    bnez $t1, ReDrawTopBar

    # Grey inner area
    move $t0, $t4           
    addi $t0, $t0, 260      
    li $t5, 7               
ReFillGreyRows:
    li $t6, 5               
    move $t7, $t0           
ReFillGreyCols:
    sw $t3, 0($t7)
    addi $t7, $t7, 4        
    addi $t6, $t6, -1
    bnez $t6, ReFillGreyCols

    addi $t0, $t0, 256      
    addi $t5, $t5, -1
    bnez $t5, ReFillGreyRows

ReDrawSoccerBalls:
    # Redraw remaining soccer balls based on goals scored
    la  $t1, squares
    lw $t3, black           
    lw $t7, white           

    jal SoccerBallCount     # Update soccer ball count based on goals

SoccerBall_Loop:
    # Draw soccer ball pattern (same as initial draw)
    # Row 1
    sw $t7, 6884($t1)   
    sw $t3, 6888($t1)   
    sw $t7, 6892($t1)   
    sw $t7, 6896($t1)   
    sw $t7, 6900($t1)   
    
    # Row 2
    sw $t3, 7140($t1)   
    sw $t7, 7144($t1)   
    sw $t3, 7148($t1)   
    sw $t7, 7152($t1)   
    sw $t3, 7156($t1)   
    
    # Row 3
    sw $t7, 7396($t1)   
    sw $t3, 7400($t1)   
    sw $t7, 7404($t1)   
    sw $t3, 7408($t1)   
    sw $t7, 7412($t1)   
    
    # Row 4
    sw $t3, 7652($t1)   
    sw $t7, 7656($t1)   
    sw $t3, 7660($t1)   
    sw $t7, 7664($t1)   
    sw $t3, 7668($t1)   
    
    # Row 5
    sw $t7, 7908($t1)   
    sw $t7, 7912($t1)   
    sw $t3, 7916($t1)   
    sw $t7, 7920($t1)   
    sw $t7, 7924($t1)   

    addi $t4, $t4, -1       
    addi $t1, $t1, -80      
    bnez $t4, SoccerBall_Loop

    j gameLoop              

SoccerBallCount:
    # Calculate remaining soccer balls based on goals scored
    lw $s0, goals_count     
    li $t4, 3               
    sub $t4, $t4, $s0       # 3 - goals scored
    jr $ra                  
####################################################################

checkCollision:
    # Check if ball collides with goal or boundaries
    lw $t1, ball_pos      
    lw $t2, goal_pos        
    
    # Check for out of bounds
    slti $t3, $t1, 0        # Check if < 0
    bnez $t3, ballOutOfBounds
    
    li $t3, 8188            # Max position
    slt $t4, $t3, $t1       # Check if > max
    bnez $t4, ballOutOfBounds
    
    # Calculate if ball is in goal area
    addi $t3, $t2, 260      # Top-left inside corner of goal
    
    # Goal collision detection
    sub $t4, $t1, $t2       # Difference between ball and goal positions
    
    # Get column difference
    div $t5, $t1, 256
    mul $t5, $t5, 256
    sub $t6, $t1, $t5       # ball column offset
    
    div $t5, $t2, 256
    mul $t5, $t5, 256
    sub $t7, $t2, $t5       # Goal column offset
    
    sub $t8, $t6, $t7       # Column difference
    
    # Check if ball is within goal's horizontal range
    slti $t5, $t8, 24       # Within goal width
    beqz $t5, ContinueGame
    bgez $t8, CheckVertical # Must be positive (not left of goal)
    j ContinueGame
    
CheckVertical:
    # Check if ball is within goal's vertical range
    div $t5, $t1, 256       # Ball row
    div $t6, $t2, 256       # Goal row
    sub $t7, $t5, $t6       # Row difference
    
    slti $t5, $t7, 8        # Within goal height (8 rows)
    beqz $t5, ContinueGame
    bgez $t7, goalEvent     # If within range, it's a goal!
    
ContinueGame:
    # No collision, continue game
    j ReDraw

goalEvent:
    # Handle goal scoring event
    
    # Play scoring sound effect
    li $v0, 31              
    li $a0, 60              # Higher pitch for goal
    li $a1, 300             # Duration
    li $a2, 1               # Piano instrument
    li $a3, 127             # Max volume
    syscall
    
    # Add score points
    addi $s3, $s3, 10       # 10 points per goal
    
    # Update goals counter
    lw $t0, goals_count
    addi $t0, $t0, 1
    sw $t0, goals_count
    
    # Check if all 3 goals scored
    beq $t0, 3, gameOver
    
    # Display score message
    li $v0, 56              
    la $a0, score_msg
    lw $a1, goals_count     
    syscall
    
    # Generate new goal position
    jal RandomGoalPosition
    
    # Reset ball position
    li $t1, 1024            # Center position
    sw $t1, ball_pos      
    
    # Reset keyboard input
    sw $zero, 0xffff0004
    
    j ReDraw
    
ballOutOfBounds:
    # Handle ball going out of bounds
    
    # Display boundary message
    li $v0, 55              
    li $a1, 0               # Information message type
    la $a0, hit_boundary_msg
    syscall
    
    # Play boundary collision sound
    li $v0, 31              
    li $a0, 71              # Lower pitch for boundary hit
    li $a1, 500             # Duration
    li $a2, 96              # Instrument
    li $a3, 100             # Volume
    syscall
    
    # Reset ball position
    li $t1, 1024            # Center position
    sw $t1, ball_pos      
    
    j ReDraw                
    
####################################################################      
gameLoop:
    # Main game loop for handling input and updates
    lw  $t7, 0xffff0004     # Get user input

    # Control game speed
    li  $v0, 32             
    li  $a0, 50             # 50ms sleep
    syscall
  
    # Update timer only after ball starts moving
    bne $t9, 1, GetInput    
    jal UpdateTimer         

GetInput:
    # Handle keyboard controls
    beq $t7, 119, GoUp      # 'w' key
    beq $t7, 115, GoDown    # 's' key
    beq $t7, 97, GoLeft     # 'a' key
    beq $t7, 100, GoRight   # 'd' key
    
    # No valid key pressed
    j gameLoop              
                                
UpdateTimer:
    # Increment score/timer while playing
    addi $s3, $s3, 1        
    jr $ra

GoUp:
    # Move ball upward
    sw $zero, 0xffff0004    # Clear input
    lw $t0, ball_pos      
    addi $t1, $t0, -1280    # Move up 5 rows
    sw $t1, ball_pos      
    j   checkCollision

GoDown:
    # Move ball downward
    sw $zero, 0xffff0004    
    lw $t0, ball_pos      
    addi $t1, $t0, 1280     # Move down 5 rows
    sw $t1, ball_pos      
    j   checkCollision

GoLeft:
    # Move ball left
    sw $zero, 0xffff0004    
    lw $t0, ball_pos      
    addi $t1, $t0, -24      # Move left 6 columns
    sw $t1, ball_pos      
    j   checkCollision

GoRight:
    # Move ball right
    sw $zero, 0xffff0004    
    lw $t0, ball_pos      
    addi $t1, $t0, 24       # Move right 6 columns
    sw $t1, ball_pos      
    j   checkCollision

gameOver:
    # Game over after scoring 3 goals
    
    # SOLUTION: Draw directly to the squares buffer where the bitmap display is looking
    la $t0, squares           # Use the SAME buffer used throughout the game
    la $t1, color_array       # Your pre-defined image data
    li $t2, 0                 # Counter
    li $t3, 2048              # Total number of pixels (32x64 display)
    
display_loop:
    beq $t2, $t3, display_complete
    
    lw $t4, 0($t1)            # Load color from your image array
    sw $t4, 0($t0)            # Store to display
    
    addi $t0, $t0, 4          # Next display position
    addi $t1, $t1, 4          # Next color
    addi $t2, $t2, 1          # Increment counter
    j display_loop

display_complete:
    # SOLUTION: Add a significant delay to see the image before messages appear
    li $v0, 32                # Sleep syscall
    li $a0, 2000              # 2 second delay - MUCH longer for debugging
    syscall
    
    # Play game over sound sequence
    li $v0, 31              
    li $a0, 60              # Note C
    li $a1, 200             # Duration
    li $a2, 1               # Piano instrument
    li $a3, 127             # Max volume
    syscall
    
    li $v0, 32              # Sleep syscall
    li $a0, 100             # Sleep for 100ms
    syscall
    
    li $v0, 31              
    li $a0, 59              # Note B
    li $a1, 200             # Duration
    li $a2, 1               # Piano instrument
    li $a3, 127             # Max volume
    syscall
    
    li $v0, 32              # Sleep syscall
    li $a0, 100             # Sleep for 100ms
    syscall
    
    li $v0, 31              
    li $a0, 58              # Note A#
    li $a1, 400             # Longer duration
    li $a2, 1               # Piano instrument
    li $a3, 127             # Max volume
    syscall
    
    # Display final score
   
    li $v0, 56              
    la $a0, game_over_msg
    add $a1, $s3, $0        
    syscall
    
    # Ask to play again
    li $v0, 50              
    la $a0, playAgain
    syscall
    
    beq $a0, 0, BEGIN       # Restart game if Yes
    
    # Exit program if No
    li $v0, 10              
    syscall
####################################################################    
RandomGoalPosition:
    # Generate random position for the goal
    
    # Random row (0-15)
    li  $v0, 42             
    li  $a0, 0              
    li  $a1, 16             
    syscall
    
    mul $t0, $a0, 256       # Convert to row offset
    
    # Random column (0-23)
    li  $v0, 42             
    li  $a0, 0              
    li  $a1, 24             
    syscall
    
    mul $t1, $a0, 4         # Convert to column offset
    add $t0, $t0, $t1       # Combine row and column offsets
    
    sw  $t0, goal_pos       # Store new goal position
    jr  $ra
